#include <Modules/Visualization/TextBuilder.h>

using namespace SCIRun::Modules::Visualization;
using namespace SCIRun::Core::Geometry;

TextBuilder::TextBuilder(const char * text, const double scale,
            const Core::Geometry::Vector shift)
: text_(text), scale_(scale), shift_(shift) {
    
}

void TextBuilder::getStringVerts(std::vector<Core::Geometry::Vector> &verts,  std::vector<Core::Geometry::Vector> &colors) {
    Vector shift = shift_;
    for (auto a : text_) {
        std::vector<Vector> tmp;
        std::vector<Vector> tmp2;
        getCharVerts(a, tmp,tmp2);
        for (auto v : tmp) {
            verts.push_back(v + shift);
        }
        for (auto v : tmp2) {
            colors.push_back(v);
        }
        shift = shift + Vector(scale_,0.,0.);
    }
}

void TextBuilder::getCharVerts(const char c, std::vector<Core::Geometry::Vector> &verts,  std::vector<Core::Geometry::Vector> &colors) {
    //get the offset into the font array.
    size_t row = c / 16;
    size_t col = c % 16;
    size_t pixel_row = 512 - row * 32 - 32;
    size_t pixel_col = col * 32;
    const uint16_t *font = font0_;
    size_t resolution = 64;
    for (size_t i = 0; i < resolution; i++) {
        for (size_t j = 0; j < resolution; j++) {
            //sample resolution x resolution across the square of the current letter.
            size_t sample_x = 6 + pixel_col + static_cast<size_t>(18. * static_cast<double>(i) / static_cast<double>(resolution)+.5);
            size_t sample_y = pixel_row + static_cast<size_t>(30. * static_cast<double>(j) / static_cast<double>(resolution)+.5);
            uint16_t pixel = font[sample_y*512 + sample_x];
            unsigned char val = (pixel >> 8) & 0x00ff;
            unsigned char alpha = pixel & 0x00ff;
            if (alpha > 10) {
                verts.push_back(scale_ * Vector(static_cast<double>(i),static_cast<double>(j),0.) / static_cast<double>(resolution));
                colors.push_back(Vector(static_cast<float>(val) / 255.f,static_cast<float>(alpha) / 255.f,0.));
            }
        }
    }
}

void TextBuilder::reset(const char * text, const double scale,
            const Core::Geometry::Vector shift) {
    text_ = text;
    scale_ = scale;
    shift_ = shift;
}

